import React, { Component } from "react";
import "./Interests.css";

export class Interests extends Component {
  constructor() {
    super();
    this.state = {
      interests: [],
      newInterest: "",
      selectedCategories: [], // Track the selected news categories
      categories: [
        "business",
        "entertainment",
        "health",
        "science",
        "sports",
        "technology",
      ], // Available categories
      newsArticles: [], // Store fetched news articles
    };
  }

  componentDidMount() {
    const savedInterests = JSON.parse(localStorage.getItem("userInterests")) || [];
    this.setState({ interests: savedInterests });
  }

  handleAddInterest = () => {
    const { interests, newInterest } = this.state;
    if (newInterest && !interests.includes(newInterest)) {
      const updatedInterests = [...interests, newInterest];
      this.setState({ interests: updatedInterests, newInterest: "" });
      localStorage.setItem("userInterests", JSON.stringify(updatedInterests));
    }
  };

  handleInputChange = (e) => {
    this.setState({ newInterest: e.target.value });
  };

  handleCategoryChange = (e) => {
    const { selectedCategories } = this.state;
    const category = e.target.value;

    if (category && !selectedCategories.includes(category)) {
      this.setState((prevState) => ({
        selectedCategories: [...prevState.selectedCategories, category],
      }), () => {
        this.fetchNews();
      });
    }
  };

  fetchNews = () => {
    const { selectedCategories } = this.state;
    // Fetch news articles based on selected categories
    const fetchPromises = selectedCategories.map((category) => 
      fetch(`https://newsapi.org/v2/top-headlines?category=${category}&apiKey=YOUR_API_KEY`)
        .then(response => response.json())
        .then(data => ({ category, articles: data.articles }))
    );

    Promise.all(fetchPromises)
      .then(results => {
        const newsArticles = results.flatMap(result => result.articles.map(article => ({
          category: result.category,
          ...article,
        })));
        this.setState({ newsArticles });
      });
  };

  render() {
    const { selectedCategories, newsArticles, categories } = this.state;

    return (
      <div className="interests-container">
        {newsArticles.length > 0 ? (
          <div className="news-articles">
            <h2>Fetched News Articles</h2>
            {newsArticles.map((article, index) => (
              <div key={index} className="news-article">
                <h3>{article.title}</h3>
                <p>{article.description}</p>
                <a href={article.url} target="_blank" rel="noopener noreferrer">Read more</a>
              </div>
            ))}
          </div>
        ) : (
          <div className="interests-list">
            <h2>Your News Interests</h2>
            {selectedCategories.length === 0 ? (
              <p>Please select your news categories.</p>
            ) : (
              <ul>
                {selectedCategories.map((category, index) => (
                  <li key={index}>{category.charAt(0).toUpperCase() + category.slice(1)}</li>
                ))}
              </ul>
            )}
          </div>
        )}

        <div className="add-interest">
          <input
            type="text"
            value={this.state.newInterest}
            onChange={this.handleInputChange}
            placeholder="Add a new interest"
          />
          <button onClick={this.handleAddInterest} className="add-button">Add</button>
        </div>

        <div className="category-selection">
          <label htmlFor="categories">Select your news category:</label>
          <select id="categories" onChange={this.handleCategoryChange}>
            <option value="">-- Select a category --</option>
            {categories.map((category) => (
              <option key={category} value={category}>
                {category.charAt(0).toUpperCase() + category.slice(1)}
              </option>
            ))}
          </select>
        </div>
      </div>
    );
  }
}

export default Interests;
